import React, { Component } from 'react';
import './Cart.css';
import './Roll.css';

class Cart extends Component {
  render() {
    console.log("this.props.rollData", this.props.rollData)
    console.log("this.props.cart", this.props.cart)
    // className= {cartClass}
    // totalPrice= {this.props.totalPrice}
    // cart= {this.props.cart}
    // rollData= {this.props.rollData}
    return (
        <div className={this.props.className}>
          <p>Shopping Cart ({this.props.itemCount} items)</p>
          <p>Total: $ {this.props.totalPrice}</p>
          <img src={this.props.cart[0].imageURL} className="roll-picture" alt={`a ${this.props.cart[0].name}`} />
          <div>
            {this.state.props.rollData.map((data) => {
      return (
        <View><Text>{data.time}</Text></View>
      )
    })}
          </div>

        </div>

    );
  }
}

export default Cart;
